import React from "react";
import Container from 'react-bootstrap/Container'

const Login = () => {
  return (
    <Container
      class = "bg-image"
      style = "
        background-image = url('https://vcdn1-vnexpress.vnecdn.net/2022/09/15/-4772-1663217379.jpg?w=500&h=300&q=100&dpr=2&fit=crop&s=BCGz6Qss-61UM6NuBhtQCg');
        height = 100vh;
      "
    >
      <div>login</div>
    </Container>
  );
};

export default Login;
